// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract RegistroDeEmpleado{

    address public propietario;

    struct Empleado {
        uint256 idEmpleado; 
        string nombre;
        uint256 salario;
    }
    // Empleado 27, "ZM", 25000
    
    mapping (uint256 => Empleado) public empleados;
   
    // 27 => Empleado (27, "ZM", 25000)
    // empleados[27]; //Empleado(27, "ZM", 25000)
    // empleado[27].idEmpleado; //27


    constructor() {
        propietario = msg.sender;
    }

    function agregarEmpleado(
        uint256 _idEmpleado,
        string memory _nombre,
        uint256 _salario
    ) public {

    //Comprobar el propietario       
        
        require(propietario == msg.sender, "Error: No eres el propietario");

    //id unico

    require(empleados [_idEmpleado].idEmpleado == 0, "Error: El empleado ya existe");

    // Agregar empleado al mapping
        
        empleados [_idEmpleado] = Empleado(
            _idEmpleado,
            _nombre,  
            _salario
        );

    }

    // Obtener Empleado

    function  obtenerEmpleado (uint256 _idEmpleado) public view returns(
        uint256, 
        string memory, 
        uint256
    ){
        //Condicion: Comprobar si el empleado existe
        //TO-DO
        //1ยบ opcion: DEVOLVER DATOS DEL EMPLEADO
        //Empleado memory elEmpleado = empleados[_idEmpleado]; // Empleado 27, "ZM", 25000

        //2a opcion: devolver datos del empleado
        return (
            empleados[_idEmpleado].idEmpleado,
            empleados[_idEmpleado].nombre,
            empleados[_idEmpleado].salario
        );

    
    
    }

//Paso 8
//paso 9

}

